import React from 'react';
import './Contact.css';
import img1 from '../../images/whatsapp.png';
import img2 from '../../images/gmail.png';
import img3 from '../../images/placeholder.png';
export default function Contact(){


    return(
        <>
           <div className="panel c" id='c'>
               <div className="v-line"></div>
                <div className="c-left">
                   <div className="c-left-wrapper">
                       <div className="mail">
                           <img src={img2} alt="" className="img" />
                           <h2 className="text">kaifsid774@gmail.com</h2>
                       </div>
                       <div className="phone">
                           <img src={img1} alt="" className="img" />
                           <h2 className="text">(+91)9119967505</h2>
                        </div>
                       <div className="address">
                           <img src={img3} alt="" className="img" />
                           <h2 className="text">New Delhi , India</h2>
                        </div>
                   </div>
                   <div className="c-left-des">
                       <h1>Let's Discuss Your Project</h1>
                   </div>
                </div>
                <div className="c-right">
                        <div className="c-right-des">
                            I am available for internships and freelancing . 
                            For More , get in touch with me !
                        </div>
                        <form action="" onSubmit={(e)=>{
                            e.preventDefault();
                            const name=e.target[0].value;
                            const sub=e.target[1].value;
                            const email=e.target[2].value;
                            const msg=e.target[3].value;
                            if(name===""|sub===""|email==="")
                            alert("Can't Take empty values");
                            else{       
                            alert(`Hello ${name} I will reply you ASAP`);
                            document.getElementById("name").value="";
                            document.getElementById("sub").value="";
                            document.getElementById("mail").value="";
                            document.getElementById("msg").value="";
                            }
                        }}>
                            <input type="text"  id='name' name='name' placeholder=' Enter Name' />
                            <input type="text" id='sub' name='subject' placeholder=' Subject' />
                            <input type="email" id='mail' name='email' placeholder=' Email' />
                            <textarea name="message" id='msg' placeholder=' Message' cols="30" rows="5"></textarea>
                            <button>Submit</button>
                        </form>
                </div>
           </div>
        </>
    )
}



